import React from "react";
import ReactQuill from "react-quill";
import { Card, CardHeader, CardBody, Form, FormInput, Button, Row, Col } from "shards-react";

import "react-quill/dist/quill.snow.css";
import "../../assets/quill.css";

const Editor = () => (
  <Card small className="mb-3">
    <CardHeader>
      <Row>
         <Col className="mb-4">
      <h6 className="m-0"> 주문내역 </h6>
      </Col>
      <Button size="sm" theme="primary" className="mb-2 mr-1">
        대기열
      </Button>
      <Button size="sm" theme="primary" className="mb-2 mr-1">
        완료
      </Button>
      </Row>
    </CardHeader>
    <CardBody>
      <Form className="add-new-post">
        <FormInput size="lg" className="mb-3" placeholder="Your Post Title" />
        <ReactQuill className="add-new-post__editor mb-1" />
      </Form>
    </CardBody>
  </Card>
);

export default Editor;
